import React, { createContext, useState } from "react";
import { Context } from "./components/Initial";
import { MyComp } from "./components/MyComp";


function App() {
  const myFunction = () => { console.log('see paragraph.') }

  return (
    <>
      <Context.Provider onClick={myFunction}>
        <MyComp />
      </Context.Provider>
    </>
  );
};

export default App;
